import { SMALL_IMG_COVER_BASE_URL } from "../../config";
import s from "./style.module.css";

export function TVShowListItem({ tvShow }) {
  return (
    <div>
      <img src={SMALL_IMG_COVER_BASE_URL + tvShow.backdrop_path} alt="" />
      <div></div>
    </div>
  );
}
